import React from 'react';
import './App.css';

function Nav() {
  return (
    <nav><h3>Categories</h3>
    <ul className="navlinks">
      <li>Summer</li>
      <li>Winter</li>
      <li>Spring</li>
    </ul>
    </nav>
  );
}

export default Nav;
